import { createRouter, createWebHistory } from "vue-router";
import Login from "../views/LoginForm.vue";
import Register from "../views/RegisterForm.vue";
import Temp from "../views/TempAll.vue";
import DoctorSpace from "../views/DoctorSelfSpace.vue";
import PatientSpace from "../views/PatientSelfSpace.vue";
import Message from "../views/Message.vue";
import ForgetPwd from "../views/ForgetPwd.vue";
import DoctorRoot from "../views/DoctorRoot.vue";


const routes = [
    {   path:"/",
        redirect:"/patientRoot"
    },
    {
        path:"/doctorRoot",
        name:"DoctorRoot",
        component:DoctorRoot
    },
    {
        path: "/login",
        name: "Login",
        component: Login
    },
    {
        path: "/register",
        name: "Register",
        component: Register
    },
    {
        path: "/temp",
        name: "Temp",
        component: Temp
    },
    {
        path: "/doctorSpace",
        name: "DoctorSpace",
        component: DoctorSpace
    },
    { path: "/patientSpace",
      name: "PatientSpace",
      component: PatientSpace
    },
    {
        path: "/message",
        name: "Message",
        component: Message
    },
    {
        path: "/ForgetPwd",
        name: "ForgetPwd",
        component: ForgetPwd
    }
];

const router = createRouter({
    history: createWebHistory(),
    routes,
});

export default router;
